import React from 'react';
import { Box, Typography, Button, Grid } from '@mui/material';
import { styled } from '@mui/system';

// Import the images
import s1s from '..//s1s.jpg';
// import s2 from './s2.jpg';
// import s3 from './s3.jpg';
// import s4 from './s4.jpg';
// import s5 from './s5.jpg';
// import s6 from './s6.jpg';
// import s7 from './s7.jpg';
// import s8 from './s8.jpg';
// import s9 from './s9.jpg';

// Updated sample data with imported images
const mensClothingItems = [
  {
    name: 'The Iconic Mesh Polo Shirt - All Fits',
    brand: 'Polo Ralph Lauren',
    price: '$100.00',
    discountedPrice: '$69.89',
    image: s1s,
    colors: 47,
  },
//   {
//     name: 'The Iconic Oxford Shirt - All Fits',
//     brand: 'Polo Ralph Lauren',
//     price: '$126.00',
//     discountedPrice: '$99.89',
//     image: s2, // Using imported image
//     colors: null,
//   },
//   {
//     name: 'Textured Cotton-Linen Sweater',
//     brand: 'Polo Ralph Lauren',
//     price: '$125.00',
//     image: s3, // Using imported image
//     colors: 5,
//   },
//   {
//     name: 'The Iconic Mesh Polo Shirt - All Fits',
//     brand: 'Polo Ralph Lauren',
//     price: '$100.00',
//     discountedPrice: '$69.89',
//     image: s4,
//     colors: 47,
//   },
//   {
//     name: 'The Iconic Oxford Shirt - All Fits',
//     brand: 'Polo Ralph Lauren',
//     price: '$126.00',
//     discountedPrice: '$99.89',
//     image: s5, // Using imported image
//     colors: null,
//   },
//   {
//     name: 'Textured Cotton-Linen Sweater',
//     brand: 'Polo Ralph Lauren',
//     price: '$125.00',
//     image: s6, // Using imported image
//     colors: 5,
//   },{
//     name: 'The Iconic Mesh Polo Shirt - All Fits',
//     brand: 'Polo Ralph Lauren',
//     price: '$100.00',
//     discountedPrice: '$69.89',
//     image: s7,
//     colors: 47,
//   },
//   {
//     name: 'The Iconic Oxford Shirt - All Fits',
//     brand: 'Polo Ralph Lauren',
//     price: '$126.00',
//     discountedPrice: '$99.89',
//     image: s8, // Using imported image
//     colors: null,
//   },
//   {
//     name: 'Textured Cotton-Linen Sweater',
//     brand: 'Polo Ralph Lauren',
//     price: '$125.00',
//     image: s9, // Using imported image
//     colors: 5,
//   },
];

// Styled components for the layout
const CategoryButton = styled(Button)({
  color: '#000',
  padding: '8px 16px',
  fontSize: '0.9rem',
  textTransform: 'none',
  borderRadius: '20px',
  margin: '0 5px',
  backgroundColor: '#f0f0f0',
  '&:hover': {
    backgroundColor: '#e0e0e0',
  },
});

const ItemImage = styled('img')({
  width: '100%',
  height: '400px',
  objectFit: 'cover',
  borderRadius: '8px',
});

const MensPage = () => {
  return (
    <Box sx={{ padding: '20px', maxWidth: '1440px', margin: '0 auto' }}>
      {/* Page Header */}
      <Typography variant="h4" sx={{ fontWeight: 'bold', marginBottom: '20px' }}>
        Men's Clothing
      </Typography>

      {/* Category Navigation */}
      <Box sx={{ display: 'flex', gap: '10px', marginBottom: '20px', overflowX: 'auto' }}>
        <CategoryButton>Polo Shirts</CategoryButton>
        <CategoryButton>Casual Icons</CategoryButton>
        <CategoryButton>T-Shirts</CategoryButton>
        <CategoryButton>Sweatshirts</CategoryButton>
        <CategoryButton>Sweatpants</CategoryButton>
        <CategoryButton>Sweaters</CategoryButton>
        <CategoryButton>View All</CategoryButton>
      </Box>

      {/* Highlighted Category */}
      <Typography variant="h6" sx={{ marginBottom: '20px', fontWeight: 'bold' }}>
        The Iconic Mesh Polo Shirt - All Fits
      </Typography>

      {/* Clothing Items Grid */}
      <Grid container spacing={3}>
        {mensClothingItems.map((item, index) => (
          <Grid item xs={12} sm={6} md={4} key={index}>
            <Box sx={{ textAlign: 'center' }}>
              <ItemImage src={item.image} alt={item.name} />
              <Typography variant="body2" sx={{ fontWeight: 'bold', marginTop: '10px' }}>
                {item.name}
              </Typography>
              <Typography variant="body2" color="textSecondary">
                {item.brand}
              </Typography>
              <Box sx={{ display: 'flex', justifyContent: 'center', gap: '10px', marginTop: '5px' }}>
                <Typography variant="body2" sx={{ textDecoration: item.discountedPrice ? 'line-through' : 'none', color: item.discountedPrice ? 'textSecondary' : 'textPrimary' }}>
                  {item.price}
                </Typography>
                {item.discountedPrice && (
                  <Typography variant="body2" sx={{ color: 'red' }}>
                    {item.discountedPrice}
                  </Typography>
                )}
              </Box>
              {item.colors && (
                <Typography variant="body2" color="textSecondary" sx={{ marginTop: '5px' }}>
                  {item.colors} colors available
                </Typography>
              )}
            </Box>
          </Grid>
        ))}
      </Grid>
    </Box>
  );
};

export default MensPage;
